def set_input_data(spark: SparkSession, config: ConfigParser):

    # grid data
    grid_do = SilverGridDataObject(spark, config.get(CONFIG_SILVER_PATHS_KEY, "grid_data_silver"))

    grid_df = spark.createDataFrame(generate_input_grid_data())

    grid_df = grid_df.withColumn(ColNames.geometry, STC.ST_GeomFromEWKT(ColNames.geometry))
    grid_df = apply_schema_casting(grid_df, SilverGridDataObject.SCHEMA)
    grid_do.df = grid_df

    grid_do.write()

    net_do = SilverNetworkDataObject(spark, config.get(CONFIG_SILVER_PATHS_KEY, "network_data_silver"))

    net_df = spark.createDataFrame(generate_input_network_data(), schema=SilverNetworkDataObject.SCHEMA)
    net_df = apply_schema_casting(net_df, SilverNetworkDataObject.SCHEMA)

    net_do.df = net_df
    net_do.write()
